  `task_id` varchar(64) NOT NULL COMMENT '任务唯一ID',
  `task_type` int NOT NULL COMMENT '任务类型',
  `target_table` varchar(100) DEFAULT NULL COMMENT '目标表名',
  `target_id` varchar(100) DEFAULT NULL COMMENT '目标记录ID',
  `execution_result` varchar(20) NOT NULL COMMENT '执行结果：success/failed/skipped',
  `processed_count` int DEFAULT NULL COMMENT '处理记录数',
  `success_count` int DEFAULT NULL COMMENT '成功记录数',
  `failed_count` int DEFAULT NULL COMMENT '失败记录数',
  `skipped_count` int DEFAULT NULL COMMENT '跳过记录数',
  `execution_details` json DEFAULT NULL COMMENT '执行详情',
  `error_message` text COMMENT '错误信息',
  `started_at` datetime NOT NULL COMMENT '开始时间',
  `completed_at` datetime DEFAULT NULL COMMENT '完成时间',
  `duration_ms` int DEFAULT NULL COMMENT '执行耗时（毫秒）',
  `executor_host` varchar(100) DEFAULT NULL COMMENT '执行主机',
  `executor_process_id` int DEFAULT NULL COMMENT '执行进程ID',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ix_compensation_task_log_task_id` (`task_id`),
  KEY `ix_compensation_task_log_id` (`id`),
  KEY `idx_task_type_result` (`task_type`,`execution_result`),
  KEY `ix_compensation_task_log_created_at` (`created_at`),
  KEY `idx_started_at_completed` (`started_at`,`completed_at`),
  KEY `ix_compensation_task_log_task_type` (`task_type`),
  KEY `ix_compensation_task_log_execution_result` (`execution_result`),
  KEY `idx_target_table_id` (`target_table`,`target_id`)
) ENGINE=InnoDB AUTO_INCREMENT=776 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

