INSERT INTO `skill_classes` VALUES (1,'psmoke_detector','吸烟检测','detection','1.0','使用YOLO模型检测人员吸烟行为','PSmokeDetectorSkill','{\"name\": \"psmoke_detector\", \"type\": \"detection\", \"params\": {\"classes\": [\"psmoking\"], \"max_det\": 300, \"iou_thres\": 0.45, \"conf_thres\": 0.5, \"input_size\": [640, 640], \"smoking_person_count\": 1, \"enable_default_sort_tracking\": true}, \"status\": true, \"name_zh\": \"吸烟检测\", \"version\": \"1.0\", \"description\": \"使用YOLO模型检测人员吸烟行为\", \"required_models\": [\"yolo11_smoke\"], \"alert_definitions\": \"当检测到: 1名及以上人员吸烟时触发, 可在上方齿轮中进行设置。\"}',1,NULL,'2026-01-08 12:03:17','2026-01-08 12:03:17'),(2,'confined_space_monitor','受限空间作业监控','agent','1.0','监控井下受限空间作业的完整流程，确保符合安全规范','ConfinedSpaceMonitorSkill','{\"name\": \"confined_space_monitor\", \"type\": \"agent\", \"params\": {\"auto_disposal\": {\"enabled\": true, \"disposal_actions\": [\"voice\", \"record\", \"penalty\", \"education\"]}, \"fast_detection\": {\"enabled\": true, \"yolo_skill\": \"coco_detector\", \"target_classes\": [\"person\"], \"confidence_threshold\": 0.5}, \"decision_engine\": {\"enabled\": true, \"use_rag\": true, \"model_name\": \"reasoning_llm\", \"knowledge_base\": \"coalmine_safety_regulations\", \"llm_skill_class_id\": null}, \"final_reasoning\": {\"enabled\": true, \"model_name\": \"reasoning_llm\", \"llm_skill_class_id\": null}, \"frame_collection\": {\"enabled\": true, \"adaptive\": true, \"max_sample_rate\": 5.0, \"min_sample_rate\": 0.5, \"default_sample_rate\": 2.0, \"max_frames_per_batch\": 50}, \"temporal_analysis\": {\"enabled\": true, \"model_name\": \"coalmine_multimodal_llm\", \"incremental\": true, \"llm_skill_class_id\": null}, \"scene_understanding\": {\"enabled\": true, \"model_name\": \"coalmine_multimodal_llm\", \"system_prompt\": \"你是一个煤矿场景理解专家，请客观描述画面内容。\", \"llm_skill_class_id\": null}}, \"status\": true, \"name_zh\": \"受限空间作业监控\", \"version\": \"1.0.0\", \"description\": \"监控井下受限空间作业的完整流程，确保符合安全规范\", \"required_models\": []}',1,NULL,'2026-01-08 12:03:18','2026-01-08 12:03:18'),(3,'person_track','人员检测跟踪','detection','1.0','基于YOLO的人体检测与跟踪技能，支持停留时间分析和安全监控','PersonTrackSkill','{\"name\": \"person_track\", \"type\": \"detection\", \"params\": {\"classes\": [\"person\"], \"max_det\": 300, \"iou_thres\": 0.45, \"conf_thres\": 0.5, \"input_size\": [640, 640], \"max_disappeared\": 15, \"enable_debug_log\": false, \"dwell_time_thresh\": 30, \"overlap_threshold\": 0.7, \"enable_id_recovery\": true, \"temporal_window_size\": 5, \"enable_dwell_analysis\": true, \"enable_safety_metrics\": true, \"max_movement_distance\": 120, \"pose_change_detection\": true, \"size_change_tolerance\": 0.6, \"enable_pose_adaptation\": true, \"max_person_count_alert\": 10, \"tracking_iou_threshold\": 0.3, \"confidence_decay_factor\": 0.95, \"crowding_distance_thresh\": 100, \"enable_improved_tracking\": true, \"min_confidence_for_track\": 0.5, \"center_distance_threshold\": 80, \"enable_temporal_smoothing\": false, \"enable_appearance_matching\": true, \"enable_position_prediction\": true, \"trajectory_smoothing_alpha\": 0.7, \"enable_default_sort_tracking\": true, \"enable_trajectory_prediction\": false, \"feature_similarity_threshold\": 0.6}, \"status\": true, \"name_zh\": \"人员检测跟踪\", \"version\": \"1.0\", \"description\": \"基于YOLO的人体检测与跟踪技能，支持停留时间分析和安全监控\", \"required_models\": [\"yolo11_coco\"]}',1,NULL,'2026-01-08 12:03:20','2026-01-08 12:03:20'),(4,'callplay_detector','打电话检测','detection','1.0','使用YOLO模型检测人员打电话行为','CallPlayDetectorSkill','{\"name\": \"callplay_detector\", \"type\": \"detection\", \"params\": {\"classes\": [\"Call\", \"PlayPhone\"], \"max_det\": 300, \"iou_thres\": 0.45, \"conf_thres\": 0.5, \"input_size\": [640, 640], \"call_person_count\": 1, \"enable_default_sort_tracking\": true}, \"status\": true, \"name_zh\": \"打电话检测\", \"version\": \"1.0\", \"description\": \"使用YOLO模型检测人员打电话行为\", \"required_models\": [\"yolo11_callplay\"], \"alert_definitions\": \"当检测到: 1名及以上人员打电话时触发, 可在上方齿轮中进行设置。\"}',1,NULL,'2026-01-0