--
-- Table structure for table `sys_tenant`
--

DROP TABLE IF EXISTS `sys_tenant`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sys_tenant` (
  `id` bigint NOT NULL COMMENT '租户ID，52位合成ID',
  `tenant_name` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '租户名称',
  `company_name` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '企业名称',
  `contact_person` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '联系人',
  `contact_phone` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '联系电话',
  `username` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '系统用户名',
  `password` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '系统用户密码',
  `package` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'basic' COMMENT '租户套餐: basic(基础版)、standard(标准版)、premium(高级版)、enterprise(企业版)',
  `expire_time` date DEFAULT NULL COMMENT '过期时间',
  `user_count` int NOT NULL DEFAULT '0' COMMENT '用户数量',
  `domain` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '绑定域名',
  `address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '企业地址',
  `company_code` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '统一社会信用代码',
  `description` text COLLATE utf8mb4_unicode_ci COMMENT '企业简介',
  `status` int DEFAULT '0' COMMENT '状态: 0(启用)、1(禁用)',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标记',
  `create_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='租户表';
/*!40101 SET character_set_client = @saved_cs_client */;

